export default function AboutTags() {
  const arrayTags = [
    cats,
    lasagne,
    movies,
    gaming,
    fantasy,
    cyberpunk,
    gorillaz,
    kakao,
    kazoo,
    shrek,
  ];
  const listTags = arrayTags.map((element) => <li>{element}</li>);

  return (
    <section>
      <ul></ul>
    </section>
  );
}
